Pseudomugil gertrudae, communément connu sous le nom de demoiselle gertrude et parfois de Rasborus gertrudae, est un petit poisson d'eau douce de la famille des desmées. Ce poisson provient du sud-est de l'Asie, notamment dans les eaux froides des bassins des fleuves Yangtze Supérieur, Zhu Jiang et Irrawaddy. En ce qui nous concerne, l’espèce a été aperçue jusqu’en Thaïlande et en Birmanie, toutefois quelques spécimens ont été signalés plus au nord, c’est-à-dire jusqu’au Nord-Est de la Chine.

Ses caractéristiques sont les suivantes :
- le corps est long, très élancé, et se termine par une nageoire caudale en coin ;
- la tête est petite et la bouche en dessous de celle-ci, assez petite également. Comme tout poisson, elle garde de façon permanente une petite ouverture quand le poisson ferme la bouche ;
- la coloration naturelle de cette espèce est assez particulière. Le poisson possède en effet une coloration argentée avec un aspect irisé mais des tonalités allant du jaune au rouge pour certaines parties seulement de son corps, en particulier son dos ;
- en aquarium les demoiselles gertrude gardent leur aspect originel, cependant elles tendent, au bout d'un certain temps, à devenir pâle.
En résumé, l'espèce Pseudomugil gertrudae fait partie de la famille des desmées, et est découverte en particulier dans les fleuves, bassins et rivières d'Asie.  Elle est caractérisée par son corps long, fin et argenté avec certaines parties dont une ligne rouge sur ses flancs, et pâlit en vivant en aquarium. Son alimentation est peu variée et végétarienne (d'où l'absence de flocons ou de granulés coloriés dans ses aquariums).<|im_end|>
